import React from "react";
export default function ShowWeather({weatherData}) {
    if (Object.keys(weatherData).length === 0) {
        return (
            <div className="showWeather">
            <div id="loading-weather-data">Loading</div>
            </div>
        )
    }
    return (
        <div className="showWeather">
            <h1 className="weather_heading">Weather Data</h1>
    <section>
    {weatherData.main ? <div id="weather_data">Temperature is: {weatherData.main.temp} Farenheit</div> : <div id="loading-weather-data">Loading</div>}
    </section>

    <footer><p>Footer</p></footer>
        </div>

    )

}
